import React from 'react';
import s from './Navbar.module.css'
import {NavLink} from "react-router-dom";

const Navbar = (props) => {
    return (
        <navbar className={s.navbar}>
            <a className={s.logo} to={"/"}><span className={s.logoLetterE}>e</span>-board</a>
            <input className={s.input} type="text" value={'Поиск'}/>
            <button className={`${s.btn} ${s.button}`}>Поиск</button>
            <button className={`${s.btn} ${s.button}`}>Разместить объявление</button>
            <button className={`${s.btn} ${s.buttonActive}`}><NavLink to={'/login'}>Войти</NavLink></button>
        </navbar>
    );
};

export default Navbar;
